script: |
  super -f text -I q3237.spq | sort > q3237.out

inputs:
  - name: q3237.spq
    data: |
      SELECT ALL + 68 FROM tab2 (FORMAT parquet) AS cor0 WHERE - col1 * + - 69 * - - col2 NOT IN ( - - col0, col0, - 2, col0 + + 15 * + 32 );
  - name: tab2

outputs:
  - name: q3237.out
    data: |
      68
      68
      68
